import React from "react";
import { NavLink } from "react-router-dom";
import CommonParent from "./CommonParent";
import web from "C:/Users/maaha/Desktop/Portfolio/portfolio-site/src/Images/Katie-Author-Bio-Pic.png";
const About = () => {
  return (
    <div>
      <CommonParent
        name="Welcome to About page of"
        imgsrc={web}
        visit="/contact"
        btname="Contact Me"
      />
    </div>
  );
};

export default About;
